import React from 'react';
import { Box, Typography } from '@mui/material';

export const Home = () => (
  <Box textAlign="center" mt={0} mb={3} px={0}>    
    <Box sx={{
      height: '100vw',
      bgColor: '#0d3b66',
      borderRadius: 3,
      mb: 1,
      // background: 'url(/image/hero.gif) center/contain no-repeat'
    }} />
    <Typography variant="h4" fontWeight="bold" color="#0d3b66">Bem-vindo ao Clube Poçoscaldense de Vôo Livre</Typography>
    <Typography mt={2} fontSize="1.1rem" color="#1e90ff">
      Parapente e aventura para todos os apaixonados por voar.
    </Typography>
  </Box>
);
